import hacking from './img/hacking.jpg';
import app from './img/app.jpg';
import software from './img/software.jpg';
import web from './img/web.jpg';
import market from './img/marketing.png';
const Sdata = [
    {
        imgsrc:app,
        title:'App developement',
    },
    {
        imgsrc:web,
        title:'Web developement',
    },
    {
        imgsrc:software,
        title:'Software developement',
    },
    {
        imgsrc:hacking,
        title:'Ethical Hacking'
    },
    {
        imgsrc:market,
        title:"Marketing"
    }
]; 
export default Sdata;
